Returns up half and down half of the convex hull. Removes straight points. change != Ordering::Less to == Ordering::Greater and vice versa to contain straight points. fn convex_hull(sorted_pts: &[(i32, i32)]) -> (Vec<(i32, i32)>, Vec<(i32, i32)>) { let mut up = vec![]; let mut len = up.len(); for &p in &sorted_pts { while len >= 2 && turn(up[len - 2], up[len - 1], p) != Ordering::Less { up.pop(); len -= 1; } up.push(p); len += 1; } let mut down = vec![]; let mut len = down.len(); for &p in &sorted_pts { while len >= 2 && turn(down[len - 2], down[len - 1], p) != Ordering::Greater { down.pop(); len -= 1; } down.push(p); len += 1; } (up, down)
